import './App.css';
import Header from './components/Header';
import Cards from './components/Cards';
import { Routes,Route} from 'react-router-dom';
function App() {
  return (
    <div className="App">
      < Header/>
      <Routes>
        <Router>
        <Route path="/" element={<Cards/>} />
        </Router>
      </Routes>
    </div>
  );
}

export default App;
